import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be dynamically rendered by the script
    await page.waitForSelector('.product-card', { state: 'visible', timeout: 10000 });

    // Take a screenshot after products are loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Use a robust selector for the price elements within the product cards
    const priceSelector = '.product-card .product-price';

    // Extract all product prices using page.evaluateAll for precise data extraction
    const extractedPrices = await page.evaluateAll(priceSelector, (priceElements) => {
      // This function runs in the browser context
      // It extracts the text of the first child node (the main price)
      // This avoids capturing the strikethrough original price in the span
      return priceElements.map(el => el.firstChild.textContent.trim());
    });

    if (extractedPrices.length === 0) {
      throw new Error('No product prices were found on the page.');
    }

    return {
      success: true,
      action: "Extracted all product prices from the dynamically loaded product cards.",
      extractedData: {
        productCount: extractedPrices.length,
        prices: extractedPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error_screenshot.png')],
      error: error.message
    };
  }
}
